import './App.css';
import {Link, NavLink, Outlet, Redirect} from "react-router-dom";
import {CgPokemon} from "react-icons/cg";
import {useState} from "react";

const App = () => {

    const [token, setToken] = useState();

    if (!token) {
        <Redirect to={"/app/login"}/>
    }

    return (
        <div className={"App"}>
                <div>
                    <header className={"header"}>
                        <div className={"title"}>
                            <CgPokemon/>
                            <Link to={"/"} className={"titleLink"}>Pok√©Builder</Link>
                        </div>
                        <div className={"navBar"}>
                            <NavLink className={({isActive}) => isActive ? "activeLink" : "inactiveLink"}
                                     to={"/app/build"}>Build</NavLink>
                            <NavLink className={({isActive}) => isActive ? "activeLink" : "inactiveLink"}
                                     to={"/app/teams"}>Teams</NavLink>
                            <NavLink className={({isActive}) => isActive ? "activeLink" : "inactiveLink"}
                                     to={"/app/login"}>Login</NavLink>
                        </div>
                    </header>
                    <Outlet/>
                </div>
            }
        </div>
    );
}

export default App;
